    function getSize(data) {
        // tslint:disable: no-bitwise
        if (data[0] === 0x89 && data[1] === 0x50 && data[2] === 0x4e && data[3] === 0x47 && data[4] === 0x0d && data[5] === 0x0a && data[6] === 0x1a && data[7] === 0x0a) {
            // PNG header found!
            return {
                type: 'png',
                width: data[16] << 24 | data[17] << 16 | data[18] << 8 | data[19],
                height: data[20] << 24 | data[21] << 16 | data[22] << 8 | data[23],
                depth: data[24],
            };
        }
        if (data[0] === 0xff && data[1] === 0xd8) {
            // JPEG found maybe
            let offset = 2;
            while (offset < data.length) {
                if (data[offset++] !== 0xff)
                    break; // It wasn't a jpeg after all.
                const marker = data[offset++];
                if (marker === 0xc0 || marker === 0xc2) {
                    // SOF marker found
                    return {
                        type: 'jpeg',
                        width: data[offset + 5] << 8 | data[offset + 6],
                        height: data[offset + 3] << 8 | data[offset + 4],
                        depth: data[offset + 2],
                    };
                }
                else {
                    // Skip the marker by reading the length.
                    offset += data[offset] << 8 | data[offset + 1];
                }
            }
        }
        if (data[0] === 0x38 && data[1] === 0x42 && data[2] === 0x50 && data[3] === 0x53) {
            // Photoshop image found!
            return {
                type: 'psd',
                width: data[14] << 24 | data[15] << 16 | data[16] << 8 | data[17],
                height: data[18] << 24 | data[19] << 16 | data[20] << 8 | data[21],
                depth: data[22] << 8 | data[23],
            };
        }
        return {
            type: "unknown"
        };
    }

    const readfileBuffer = new Uint8Array(64 * 1024);
    function readfileSync(path, flags, mode) {
        const fd = openSync(path, flags, mode);
        const parts = [];
        let offset = 0;
        let bytesRead;
        try {
            do {
                bytesRead = readSync(fd, readfileBuffer, -1);
                if (bytesRead > 0) {
                    parts.push(readfileBuffer.slice(0, bytesRead));
                    offset += bytesRead;
                }
            } while (bytesRead === readfileBuffer.byteLength);
        }
        finally {
            closeSync(fd);
        }
        // If there is exactly one part, don't copy it to a new buffer.
        if (parts.length === 1) {
            return parts[0];
        }
        // Otherwise, combine the parts into a single large buffer.
        const result = new Uint8Array(offset);
        offset = 0;
        for (const part of parts) {
            result.set(part, offset);
            offset += part.byteLength;
        }
        return result;
    }

    const REGEX_URL = /^(http(s?):\/\/.*)/;

    function isUrl(url) {
        return REGEX_URL.test(url);
    }

    async function download (urlAddress) {
        if (!isUrl(urlAddress)) {
            throw new TypeError('Invalid URL address');
        }

        let response;
        try {
            response = await fetch(urlAddress);
        } catch (error) {
            throw new Error(`Fetching form ${urlAddress} failed, error: ${error.message}`);
        }

        if (!response.ok) {
          throw new Error(`HTTP error, status = ${response.status}`);
        }

        return await response.cacheFile;
    }

    // The purpose of the resource downloader is to download image or model from remote location (url)

    const DOWNLOAD_COLOR_MASK = [0.1, 0.1, 0.1, 0.1];
    const DEFAULT_COLOR_MASK = [1, 1, 1, 1];

    function createSpinner (prism) {
        const spinner = executor.createNode(lumin.ui.UiLoadingSpinner, 'Create', prism, lumin.ui.LoadingSpinnerType.k2dSpriteAnimation);
        const [w, h] = executor.callNativeFunction(spinner, 'getSize');
        const [x, y, z] = executor.callNativeFunction(spinner, 'getLocalPosition');

        executor.callNativeAction(spinner, 'setLocalPosition', [x - (w / 2), y - (h / 2), z]);
        return spinner;
    }

    function addMaskAndSpinner (element, prism) {
        // Set color mask
        executor.callNativeAction(element, 'setColor', DOWNLOAD_COLOR_MASK);

        // Add downloading spinner
        const spinner = createSpinner(prism);
        executor.callNativeAction(element, 'addChild', spinner);

        return spinner;
    }

    function removeMaskAndSpinner (element, prism, spinner, properties) {
        // Remove color mask
        const color = (properties.color !== undefined && ColorProperty.validate(properties.color))
          ? ColorProperty.parse(properties.color)
          : DEFAULT_COLOR_MASK;
        executor.callNativeAction(element, 'setColor', color);

        // Delete spinner
        executor.callNativeAction(element, 'removeChild', spinner);
        executor.callNativeAction(prism, 'deleteNode', spinner);
    }

    function doesElementExist (element, prism) {
        const nodeId = executor.callNativeFunction(element, 'getNodeId');
        return executor.callNativeFunction(prism, 'getNode', nodeId) !== null;
    }

    async function loadRemoteResource (url, properties, element, prism, setResourceFunctionName, createResourceFunction, postLoadAction) {
        const spinner = addMaskAndSpinner(element, prism);

        // Fetch the remote image
        let filePath;
        try {
          filePath = await download(url);
        } catch (error) {
          logError(error.message);
          removeMaskAndSpinner(element, prism, spinner, properties);
          return;
        }

        const resourceId = createResourceFunction(filePath);

        if (resourceId === lumin.INVALID_RESOURCE_ID) {
          logError(`Failed to load resource from: ${url}`);
          removeMaskAndSpinner(element, prism, spinner, properties);
          return;
        }

        // Verify that the node is still part of the scene graph after asset download is complete
        if (doesElementExist(element, prism)) {
          executor.callNativeAction(element, setResourceFunctionName, resourceId);
          removeMaskAndSpinner(element, prism, spinner, properties);
          postLoadAction(filePath);
        }
    }

